import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

import { useHistory } from "react-router-dom";

//img
import bg from '../../../shared/assets/images/bg.jpg'

import {
  Containerbody,
  ContainerbodyOpacity
} from './dashboardStyle'

export function Dashboard() {
  const history = useHistory();

  return (
    <Containerbody style={{backgroundImage: `url(${bg})`}}>
      <ContainerbodyOpacity>
        <Grid
          container
          direction="row"
          justify="center"
          alignItems="center"
          style={{height:'100%'}}
        >
          <h1 style={{color:'white'}}>Marvel Quadrinhos</h1>
          <TextField 
            id="outlined-basic" 
            label="Outlined" 
            variant="outlined" 
          />
        </Grid>
      </ContainerbodyOpacity>
    </Containerbody>
  );
}
